def binary_search(arr, element, left, right): 

    # Corner cases 
    if left > right: 
        return -1

    mid = (left + right) // 2

    # Check if element is present at mid 
    if arr[mid] == element: 
        return mid 

    # If element is greater than mid, 
    # then it can only be present in right subarray 
    elif arr[mid] < element: 
        return binary_search(arr, element, mid + 1, right) 

    # Else the element can only be present 
    # in left subarray 
    else: 
        return binary_search(arr, element, left, mid - 1) 

